-- TRUNCATE DELETE ALL TABLES
DO $$
DECLARE
	seznamTabulek RECORD;
BEGIN
	FOR seznamTabulek IN SELECT tablename FROM pg_tables AS pg WHERE schemaname = 'public'
	LOOP
		EXECUTE 'TRUNCATE TABLE public.' || quote_ident(seznamTabulek.tablename) || ' CASCADE';
	END LOOP;
END $$;

-- RESET ALL SEQUENCES
DO $$
DECLARE
  seq_rec RECORD;
BEGIN
  FOR seq_rec IN SELECT sequencename FROM pg_sequences
  LOOP
    EXECUTE 'ALTER SEQUENCE ' || quote_ident(seq_rec.sequencename) || ' RESTART WITH 1';
  END LOOP;
END $$;

